import './App.css';

function Square({ value }) {
  function handleClick() {
     console.log('clicked!');
  }

  return (
    <button className="square" onClick={handleClick}>
      {value}X
    </button>
  );
}

export default function App(){
    return(
      <div>

        <div>
        <Square/>
      </div>

      <div>
        <Square/>
      </div>
      <div>
        <Square/>
      </div>
        <Square/>
      </div>
    );
};
